/* ------ JavaScript - Audio Visualizer 9 - Blue Lolly ------ */
const container = document.getElementById("container");
const canvas = document.getElementById("canvas1");
const file = document.getElementById("fileupload");
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
const ctx = canvas.getContext("2d");
ctx.lineCap = "round";
ctx.globalCompositeOperation = "luminosity";
let audioSource;
let analyser;

container.addEventListener("click", function () {
  const audio1 = document.getElementById("audio1");
  audio1.src =
    " data:audio/x-wav;base64,  ";
  const audioContext = new AudioContext();
  audio1.play();
  audioSource = audioContext.createMediaElementSource(audio1);
  analyser = audioContext.createAnalyser(); // to get time and frequency data.
  audioSource.connect(analyser);
  analyser.connect(audioContext.destination);
  analyser.fftSize = 128; // value determines the amount of visualizer bar detail.
  const bufferLength = analyser.frequencyBinCount;
  const dataArray = new Uint8Array(bufferLength);

  // const barWidth = canvas.width / 2 / bufferLength;
  const barWidth = 5; // Sets the pixel thickness of the sound bars.
  let barHeight;
  let x;

  function animate() {
    x = 0;
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    analyser.getByteFrequencyData(dataArray);
    drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray);
    requestAnimationFrame(animate);
  }
  animate();
});

file.addEventListener("change", function () {
  const files = this.files;
  const audio1 = document.getElementById("audio1");
  audio1.src = URL.createObjectURL(files[0]);
  audio1.load();
  audio1.play();
  audioSource = audioContext.createMediaElementSource(audio1);
  analyser = audioContext.createAnalyser(); // to get time and frequency data.
  audioSource.connect(analyser);
  analyser.connect(audioContext.destination);
  analyser.fftSize = 128;
  const bufferLength = analyser.frequencyBinCount;
  const dataArray = new Uint8Array(bufferLength);

  const barWidth = 15;
  let barHeight;
  let x;

  function animate() {
    x = 0;
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    analyser.getByteFrequencyData(dataArray);
    drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray);
    requestAnimationFrame(animate);
  }
  animate();
});

function drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray) {
  for (let i = 0; i < bufferLength; i++) {
    barHeight = dataArray[i] * 1.2; // Adjusting the bar height variable.
    ctx.save();
    ctx.translate(canvas.width / 2, canvas.height / 2);
    ctx.rotate((i * Math.PI * 4) / bufferLength);
    ctx.fillStyle = "dodgerblue";
    ctx.strokeStyle = "slateblue";
    ctx.lineWidth = barHeight / 10;
    ctx.beginPath();
    ctx.moveTo(0, 0);
    ctx.lineTo(0, barHeight);
    ctx.stroke();
    ctx.beginPath();
    ctx.arc(0, barHeight + barHeight / 5, barHeight / 20, 0, Math.PI * 2);
    ctx.fill();
    ctx.arc(0, barHeight + barHeight / 2, barHeight / 10, 0, Math.PI * 2);
    ctx.fill();
    x += barWidth;
    ctx.restore();
  }
}
